/**
 * Handlebars helpers
 *
 * These helpers will be available during backend processing and frontend rendering. Any "advanced" logic which
 * needs to be put into the template should be added here as a helper and then used.
 */

Handlebars.registerHelper('ifeq', function (value, test, options) {
  if (value == test) { return options.fn(this); }
  else { return options.inverse(this); }
});

Handlebars.registerHelper('ifnoteq', function (value, test, options) {
  if (value != test) { return options.fn(this); }
  else { return options.inverse(this); }
});

Handlebars.registerHelper('ifIsFolder', function (options) {
  return this.hasOwnProperty('item') ? options.fn(this) : options.inverse(this);
});

Handlebars.registerHelper('generateUID', function (ownerId, entityId) {
  return ownerId + '-' + entityId;
});

Handlebars.registerHelper('generateRequestID', function (options) {
  var attrs = [];

  for (var prop in options.hash) {
    attrs.push(options.hash[prop]);
  }

  return new Handlebars.SafeString(
    attrs.join('_').replace(/\s+/g, '')
  );
});

Handlebars.registerHelper('sanitise_snippet', function (language, code) {
  var sanitised_code = code;
  if (language === 'cURL') {
    // handle newlines and carriage returns
    sanitised_code = sanitised_code.replace(/\\n|\\r/g, '\n');
    // replace tabs with 4 spaces
    sanitised_code = sanitised_code.replace(/\\t/g, '    ');
    return sanitised_code;
  }
  return code;
});

Handlebars.registerHelper('ifempty', function (value, options) {
  if (_.isEmpty(value)) {
    return options.fn(this);
  }
  else {
    return options.inverse(this);
  }
});

Handlebars.registerHelper('ifnotempty', function (value, options) {
  if (!_.isEmpty(value)) {
    return options.fn(this);
  }
  else {
    return options.inverse(this);
  }
});

Handlebars.registerHelper('get', function (object, key, options) {
  return _.get(object, key);
});

Handlebars.registerHelper('hasRequestBody', function (value, options) {
  if (!value || _.isEmpty(value)) {
    return options.inverse(this);
  }
  else if (_.isPlainObject(value)) {
    if (!value.mode) {
      return options.inverse(this);
    }
    else if (value.mode && ((_.isPlainObject(value.mode) && _.isEmpty(value[value.mode])) || !value[value.mode])) {
      return options.inverse(this);
    }
    else {
      return options.fn(this);
    }
  }
  else {
    return options.fn(this);
  }
});

Handlebars.registerHelper('checkrequestauth', function (value, options) {
  if (_.isEmpty(value) || value.type === 'noauth') {
    return options.inverse(this);
  }
  else {
    return options.fn(this);
  }
});

Handlebars.registerHelper('checkQueryParam', function (value, options) {
  if (value) {
    return options.inverse(this);
  }
  else {
    return options.fn(this);
  }
});

Handlebars.registerHelper('getRequestMethod', function(context) {
  var requests = {
    delete: 'DEL',
    options: 'OPT',
    unlink: 'UNLNK',
    unlock: 'UNLCK',
    propfind: 'PROP',
    patch: 'PATCH'
  };

  // Normalizing casing, I've seen both Delete & DELETE for some reason :/
  if (typeof context === 'string') {
    context = context.toLowerCase();
  }
  else {
    context = context === null ? 'get' : '';
  }

  return requests[context] || context.slice(0, 4).toUpperCase();
});

/**
 * Markup languages such as html & XML can be highlighted correctly if the context is know. This helper will render the
 * main block if this is a markup language, and the inverse block otherwise. The inverse block is optional.
 */
Handlebars.registerHelper('ifIsMarkupLanguage', function (language, options) {
  if (typeof language === 'string' && ['html', 'xml'].indexOf((language).toLowerCase()) >= 0) {
    return options.fn(this);
  }
  else {
    return options.inverse(this);
  }
});

/**
 * Return true if any of the examples have a response to be displayed. False if *none* of the samples have a response.
 */
Handlebars.registerHelper('ifHasAnyResponses', function (samples, options) {
  if (Array.isArray(samples) && samples.length > 0) {
    var hasResponses = samples.some(function (sample) {
      return !!sample.response.body;
    });

    if (hasResponses) {
      return options.fn(this);
    }
  }

  return options.inverse(this);
});

/**
 * Limit output to a certain number of lines or characters, whichever is less.
 */
Handlebars.registerHelper('limitLinesOrLength', function (string, options) {
  var maxLines = options.hash.lines || 11,
    maxChars = options.hash.length || 5000,
    lineSeparator = '\n',
    lines;

  if (typeof string !== 'string') {
    return string;
  }

  lines = string.split(lineSeparator);

  if (lines.length > maxLines) {
    // Keep just the first maxLines
    string = lines
      .slice(0, maxLines)
      .join(lineSeparator);
  }
  else if (string.length > maxChars) {
    // Keep just the first maxChars
    string = string.slice(0, maxChars);
  }

  return string;
});

